import junegull from '../fonts/junegull.ttf';
import caskaydia from '../font/Caskaydia Cove Nerd Font Complete'
import { createGlobalStyle } from 'styled-components';

export default createGlobalStyle`
@font-face {
    font-family: 'Junegull';
    src: local('Junegull'),
    url(${ junegull }) format('truetype');
    font-weight: 300;
    font-style: normal;
}

@font-face {
    font-family: 'Caskaydia';
    src: local('Caskaydia Cove Nerd Font Complete'),
    url(${ Caskaydia }) format('truetype');
    font-weight: 300;
    font-style: normal;
}
`;
